  let API_URL = process.env.REACT_APP_BASE_URL;

  const fetchCharacters = async (name: string) => {
    let baseUrl = `${API_URL}:443/v1/public/characters`;
  
    let ts = Date.now().toString();
    let apiKey = process.env.REACT_APP_API_KEY;
    let url = `${baseUrl}?ts=${ts}&apikey=${apiKey}&hash=bd67ce0fc9068238c3aac6ea8ca58732&nameStartsWith=${name}`;
  
    try {
      let response = await fetch(url);
      let data = await response.json();
      console.log(data);
      return data;
    } catch (err) {
      console.error(err);
      return;
    }
  };
  
  const fetchCreators = async (name: string) => {
    let baseUrl = `${API_URL}/v1/public/creators`;
  
    let ts = Date.now().toString();
    let apiKey = process.env.REACT_APP_API_KEY;
    let url = `${baseUrl}?ts=${ts}&apikey=${apiKey}&hash=bd67ce0fc9068238c3aac6ea8ca58732&nameStartsWith=${name}`;
  
    try {
      let response = await fetch(url);
      let data = await response.json();
      console.log(data);
      return data;
    } catch (err) {
      console.error(err);
      return;
    }
  };
  
  export { fetchCharacters, fetchCreators };
